import React,{Component} from 'react';

class Card extends Component{

    render(){
        return(
            <div cla="card text-right" style="width: 18rem;">
                <img cla="card-img-top" src="..." alt="Card image cap"></img>
                <div class="card-body">
                  <h5 cla="card-title">Special title treatment</h5>
                  <p cla="card-text">With supporting text below as a natural lead-in to additional content.</p>
                  <a href="#" cla="btn btn-primary">Go somewhere</a>
                </div>
            </div>              
        );
    }
}

export default Card;
